import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import "../styles/Login.css";

const SignUpLogInForm = () => {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [fullname, setFullname] = useState("");
  const [email, setEmail] = useState("");
  const [address, setAddress] = useState("");
  const [phone, setPhone] = useState("");
  const [question, setQuestion] = useState("");
  const [answer, setAnswer] = useState("");
  const [newPassword, setNewPassword] = useState("");
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [message, setMessage] = useState("");
  const [error, setError] = useState("");
  const [isActive, setIsActive] = useState(false);
  const [isForgotPassword, setIsForgotPassword] = useState(false);
  const [isPasswordReset, setIsPasswordReset] = useState(false); // Track password reset flow
  const [username2, setUsername2] = useState("");
  const [password2, setPassword2] = useState("");
  const [isSubmitting2, setIsSubmitting2] = useState(false);
  const [message2, setMessage2] = useState("");
  const [error2, setError2] = useState("");
  const navigate = useNavigate();

  const handleRegisterClick = () => {
    setIsActive(true); // Set to true to show the Register form
  };

  const handleLoginClick = () => {
    setIsActive(false); // Set to false to show the Login form
  };

  const handleForgotPasswordClick = () => {
    setIsForgotPassword(true); // Trigger the Forgot Password flow
  };

  const handleLogin = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setMessage("");
    setError("");

    try {
      const response = await axios.post("http://localhost:5001/login", {
        username,
        password,
      });

      setMessage(response.data.message);
      localStorage.setItem("username", username);
      navigate("/home");
    } catch (err) {
      setError(err.response?.data?.error || "An unexpected error occurred.");
    } finally {
      setIsSubmitting(false);
    }
  };

  const handleSignup = async (e) => {
    e.preventDefault();
    setIsSubmitting2(true);
    setMessage("");
    setError("");

    try {
      const response = await axios.post("http://localhost:5001/create", {
        username,
        password,
        fullname,
        email,
        address,
        phone,
        question,
        answer,
      });

      setMessage(response.data.message);
      setUsername("");
      setPassword("");
      setFullname("");
      setEmail("");
      setAddress("");
      setPhone("");
      setIsActive(false);
    } catch (err) {
      setError(err.response?.data?.error || "An unexpected error occurred.");
    } finally {
      setIsSubmitting2(false);
    }
  };

  const handleSecurityQuestionSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setMessage("");
    setError("");

    try {
      // Get the security question and answer from the database based on username
      const response = await axios.post("http://localhost:5001/getSecurityQuestion", {
        username,
      });

      const { question: fetchedQuestion, correctAnswer } = response.data;

      if (answer === correctAnswer) {
        setQuestion(fetchedQuestion);
        setIsPasswordReset(true); // Allow user to set new password
      } else {
        setError("Incorrect answer to the security question.");
      }
    } catch (err) {
      setError(err.response?.data?.error || "An unexpected error occurred.");
    } finally {
      setIsSubmitting(false);
    }
  };

  const handlePasswordReset = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setMessage("");
    setError("");

    try {
      const response = await axios.post("http://localhost:5001/resetPassword", {
        username,
        newPassword,
      });

      setMessage(response.data.message);
      setIsForgotPassword(false); // Close the forgot password popup
    } catch (err) {
      setError(err.response?.data?.error || "An unexpected error occurred.");
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div className="juju">
      <div className={`container ${isActive ? "active" : ""}`}>
        <div className={`form-box login ${isActive ? "hidden" : ""}`} onSubmit={handleLogin}>
          <form action="#">
            <h1>Login</h1>
            <div className="input-box">
              <input
                type="text"
                placeholder="Username"
                onChange={(e) => setUsername(e.target.value)}
                required
              />
              <i className="bx bxs-user"></i>
            </div>
            <div className="input-box">
              <input
                type="password"
                placeholder="Password"
                onChange={(e) => setPassword(e.target.value)}
                required
              />
              <i className="bx bxs-lock-alt"></i>
            </div>
            <div className="forgot-link">
              <a href="#" onClick={handleForgotPasswordClick}>Forgot Password?</a>
            </div>
            <button type="submit" className="btn" disabled={isSubmitting2}>
              Login
            </button>
          </form>
        </div>

        {isForgotPassword && !isPasswordReset && (
          <div className="forgot-password-popup">
            <h2>Forgot Password</h2>
            <form onSubmit={handleSecurityQuestionSubmit}>
              <input
                type="text"
                placeholder="Username"
                onChange={(e) => setUsername(e.target.value)}
                required
              />
              <button type="submit" disabled={isSubmitting}>Get Security Question</button>
            </form>
            {question && (
              <>
                <p>{question}</p>
                <input
                  type="text"
                  placeholder="Answer"
                  onChange={(e) => setAnswer(e.target.value)}
                  required
                />
                <button type="submit" onClick={handleSecurityQuestionSubmit} disabled={isSubmitting}>Submit Answer</button>
              </>
            )}
            {error && <p style={{ color: "red" }}>{error}</p>}
          </div>
        )}

        {isPasswordReset && (
          <div className="reset-password-popup">
            <h2>Reset Password</h2>
            <form onSubmit={handlePasswordReset}>
              <input
                type="password"
                placeholder="New Password"
                onChange={(e) => setNewPassword(e.target.value)}
                required
              />
              <button type="submit" disabled={isSubmitting}>Change Password</button>
            </form>
          </div>
        )}

        <div className="toggle-box">
          <div className="toggle-panel toggle-left">
            <h1>Hello, Welcome!</h1>
            <p>Don't have an account?</p>
            <button className="btn register-btn" onClick={handleRegisterClick}>
              Register
            </button>
            {message && <p style={{ color: "green" }}>{message}</p>}
            {error && <p style={{ color: "red" }}>{error}</p>}
          </div>

          <div className="toggle-panel toggle-right">
            <h1>Welcome Back!</h1>
            <p>Already have an account?</p>
            <button className="btn login-btn" onClick={handleLoginClick}>
              Login
            </button>
          </div>
        </div>
      </div>
    </div>
  );
};

export default SignUpLogInForm;
